```
GET /profile/&lt;instagram_id&gt;
{
  username: string,
  biography: string,
  follower_count: int,
}

GET /profile/&lt;instagram_id&gt;/followers?cursor=&lt;cursor&gt;
{
  data: [
    id,         // string
    id,         // string
    ...
  ],
  cursor: int   // can be null
}
```

The data returned should be the following structure (implemented in Python, but the program can written in any language):

```
class InstagramProfile:
  def __init__(self, profile_id, username, biography, follower_count, followers):
