    self.username = username
    self.biography = biography
    self.follower_count = follower_count
    self.followers = followers             // needs to be filled with Profile Objects, not IDs

```

Notes: The returned array of followers must be all `Profiles`, not IDs, including the inner followers list. The cursor in the `followers` route can be `null`. Assume the server can handle the storage space of all the instagram profiles.

